    componentDidMount(){
        fetch('https://api.songkick.com/api/3.0/search/artists.json?apikey={your_api_key}&query={artist_name}')
            .then(res => res.json())//response type
            .then((data) => {
                tempHistory = data;
            })
        setTimeout(() => {
            this.mapHistory();
        }, 200);
    }
    render () {
        return <div>{this.props.artist}</div>
    }
}

export default Concerts;
